No período de realização de atividades de estágio supervisionado obrigatório, foram realizadas 63h15min, sendo subdivididas da seguinte forma, em relação aos quesitos previstos no PPC, a serem atendidos:
- 34h45min de Observação no Ensino Fundamental;
- 19h30min de Regência no Ensino Médio.
